import logo from "./logo.svg";
import "./App.css";
import Cyberpunk from "../public/Cyberpunk.jpg";

function App() {
  return (
    <div className="App">
      <header>
        <img src={Cyberpunk} className="App-logo" alt="logo" />
        <p></p>
        <a></a>
      </header>
    </div>
  );
}

export default App;
